import React from "react";
import "./Skill.css";

const Skill = () => {
  // 기능 구현 로직
  return (
    <div id="skill">
      <div class="Skill">
        <h1>Skill</h1>
        <div class="box-wraper">
          <div class="box">
            <div>HMTL/CSS</div>
            <div>javascript(ES6)</div>
            <div>React</div>
            <div>Redux</div>
          </div>
          <div class="box">test</div>
        </div>
      </div>
    </div>
  );
};

export default Skill;
